import 'package:sleep/data/models/data.dart';class Seans {  DateTime startTime;  DateTime endTime;  List<Data> datas;  Seans({ required this.startTime, required this.endTime, required this.datas});  factory Seans.fromJson(Map<String, dynamic> json) {    return Seans(      startTime:json['startTime']==null ? DateTime.now(): DateTime.parse(json['startTime']),      endTime: json['endTime']==null ? DateTime.now():DateTime.parse(json['endTime']),      datas: json['data'] != null          ? (  Map<String,dynamic>.from(json['data'] as Map)).keys.map((k) => Data.fromJson({k:Map<String,dynamic>.from(json['data'] as Map)[k]}) ).toList()          : [],    );  }  Map<String, dynamic> toJson() {    return {      'startTime': startTime.toIso8601String(),      'endTime': endTime.toIso8601String(),      'datas': datas.map((e) => e.toJson()).toList(),    };  }}